Information
------------------------------

Time Scanners: Jerusalem
The Time Scanners use cutting-edge 3D laser-scanning technology to put history's building wonders to the test, exploring the secrets of how the world's most iconic engineering creations were constructed. Leading the quest is structural engineer Steve Burrows. He is joined by laser-scanning experts from the Center for Advanced Spatial Technologies at the University of Arkansas. With unprecedented access, they explore, scan and digitally analyse some of mankind's most awe-inspiring architectural achievements, uncovering just how good the engineers of the ancient world really are. This week Time Scanners are at the ancient biblical city of Jerusalem.

